      // hide all but the first:    
      slides.slice(1).hide(); 
  
      var current = 0;
  
      setInterval(function() {
        // hide the current slide:
        slides.eq(current).hide(350);

  //       // list to the beginning as required:
        current = (current + 1) % slides.length;
        // console.log(current);

        setTimeout(function () {

        }, 500);
      }, 4000); // make the interval larger than the hide/show cycle
